import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <div className="nav">
      <div className="start">
        <ol>
          <li>about</li>
          <li>contact</li>
          <li>social</li>
        </ol>
      </div>
      <h2 className="logo">pergrid</h2>
      <div className="end">
        <ol>
          <i style="font-size:24px" ></i>
          <li>search</li>
          <li>account</li>
          <li>FAQ</li>
        </ol>
      </div>
    </div>
  );
}

export default Navbar;
